@media only screen
and (min-device-width : 320px)
and (max-device-width : 480px) {
	.slide-excerpt { display: none !important; }
}

[if IE]>
<style>@media only screen and (max-width: 960px) {	
	.section td, .section tr, .section tbody {
		display: block !important;
		width: 100% !important; 
		float: left;
		clear: both; margin: 0 auto; text-align: center;
		} }
</style>
<![endif]


@media all, print {


	@font-face{
	font-family:"Avenir";  
		src:url("https://static.gopenske.com/internet/fonts/avenir/e0542193-b2e6-4273-bc45-39d4dfd3c15b.eot?#iefix");
		src:url("https://static.gopenske.com/internet/fonts/avenir/e0542193-b2e6-4273-bc45-39d4dfd3c15b.eot?#iefix") format("eot"),
		url("https://static.gopenske.com/internet/fonts/avenir/17b90ef5-b63f-457b-a981-503bb7afe3c0.woff2") format("woff2"),
		url("https://static.gopenske.com/internet/fonts/avenir/c9aeeabd-dd65-491d-b4be-3e0db9ae47a0.woff") format("woff"),
		url("https://static.gopenske.com/internet/fonts/avenir/25f994de-d13f-4a5d-a82b-bf925a1e054d.ttf") format("truetype"),
		url("https://static.gopenske.com/internet/fonts/avenir/3604edbd-784e-4ca7-b978-18836469c62d.svg#3604edbd-784e-4ca7-b978-18836469c62d") format("svg");

	}

		body {
			margin: 0px; 
			font-family:'Avenir', sans-serif;
			letter-spacing: .5px;
		}

		#eyebrow-container {
			height: 30px; 
			background: #6a6a6a none repeat scroll 0 0;
			display: block;
			float: left;
			margin: 0 auto;
			width: 100%;
		}

		.container { 
			width: 100%;
			max-width: 960px; 
			margin: auto; 
			padding: 15px 0 15px 0;
		}

		#heading {
			position: relative;
			height: auto; 
			min-height: 55px;
			margin: 10px 0 0 0; 
			padding: 10px; 
			width: 100%;
			max-width: 910px; 
			background-color: #fecb00;
			background-image: url('https://www.pensketruckrental.com/img/hero/chevron_header.png'); 
			background-repeat: no-repeat;  
			background-position: right top; 
			background-size: contain;
		}

		#yellowbar {
			font-size: 2.188em; 
			line-height: 1.0em; 
			color: #fff; 
			float: left; 
			font-weight: 000; 
			margin: 10px; 
			text-transform: uppercase; 
			width: 100%;
		}

		#error-search {
			width: 100%;
			background: #fff; 
			border: 1px solid #dadada; 
			max-width: 928px; 
			margin: 0 0 40px 0;
		}

		#exception-message {
			color: #002496; 
			font-weight: 600; 
			margin: 60px 40px; 
			text-align: center; 
			font-size: 21px;
		}

		#greybar02 {
			height: 150px; 
			background: #6a6a6a none repeat scroll 0 0;
			display: block;
			float: left;
			margin: 0 auto;
			width: 100%;
		}

		.footer-column {
			border-right: 0 solid #d2d2d2;
		}

		#roadside-assistance {
			width: 100%;
			max-width: 960px; 
			margin: auto; 
			padding: 33px 0 10px 15px; 
			color: #fff;
		}

	.copyright {
		padding-left: 15px;

	}
		#ra-hour {
			color: #fff;
			float: left;
			font-size: 37px;
			font-weight: 700;
			line-height: 33px;
			margin: 0 6px 0 0;
		}

		#ra-title{
			color: #fff;
			float: left; 
			font-size: 17px;
			font-weight: 700;
			line-height: 17px;
			text-transform: uppercase;
		}

		#ra-call{
			color: #fff;
			float: left;
			clear:both;
			font-size: 18px;
			font-weight: 700;
			line-height: 18px;
			margin: 4px 0;
		}

		#ra-text{
			color: #fff;
			float: left;
			clear:both;
			font-size: 12px;
			line-height: 13px;
		}

		#greybar03 {
			height: 40px; 
			background: #5b5b5b none repeat scroll 0 0;
			display: table-row;
			float: left;
			margin: 0 auto;
			width: 100%;
		}

		#greybar04 {
			width: 100%;
			max-width: 960px; 
			margin: auto; 
			padding: 0px 0 10px 0; 
			color: #fff; 
			font-size: 12px;		
		}
	}

